import React from 'react'
import { useState } from 'react';

const Pop1 = ({ closePop1 }) => {
  const [textFieldValue, setTextFieldValue] = useState('');
  const [selectedOption, setSelectedOption] = useState('AI');

  const handleInputChange = (e) => {
    setTextFieldValue(e.target.value);
  };

  const handleSelectChange = (e) => {
    setSelectedOption(e.target.value);
  };

  const handleSubmit = () => {
    // Handle submission logic here
    closePop1(); // Close the modal after submission
  };


  return (
    <div>
      <p>I want to start with...</p>
      <select value={selectedOption} onChange={handleSelectChange}>
        <option value="Option 1">AI</option>
        <option value="Option 2">Myself</option>
      </select>
      <button onClick={handleSubmit}>Submit</button>
    </div>
  );
};


export default Pop1;
